function App() {
  // logic
  console.log("App.js");

  const name = "olivia";
  const age = 27;

  // 안녕하세요. olivia님! 나이게 27세 이시네요.
  // 환영합니다.

  const greetingMessage = `안녕하세요. ${name}님! 나이가 ${age}세 이시네요. \n 환영합니다`;
  console.log(greetingMessage);

  // view
  return <div>hello world</div>;
}

export default App;
